`,paraId:56,tocIndex:27},{value:"Same as ",paraId:57,tocIndex:28},{value:"tree-select",paraId:57,tocIndex:28},{value:". Both request and valueEnum are supported to generate options.",paraId:57,tocIndex:28},{value:"Requesting remote data is more complicated, see [here](/components/field#remote data) for details.",paraId:58,tocIndex:28},{value:"Why support valueEnum when you have options? valueEnum can be used with tables, descriptions, and has engineering advantages.",paraId:59,tocIndex:28},{value:"parameters",paraId:60,tocIndex:28},{value:"description",paraId:60,tocIndex:28},{value:"type",paraId:60,tocIndex:28},{value:"default",paraId:60,tocIndex:28},{value:"valueEnum",paraId:60,tocIndex:28},{value:"Enumeration of current values ",paraId:60,tocIndex:28},{value:"valueEnum",paraId:61,tocIndex:28},{value:"Record",paraId:60,tocIndex:28},{value:"-",paraId:60,tocIndex:28},{value:"request",paraId:60,tocIndex:28},{value:"Enumerate data from network requests",paraId:60,tocIndex:28},{value:"()=>Promise<{[key:string",paraId:60,tocIndex:28},{value:"|",paraId:60,tocIndex:28},{value:"number]:any}>",paraId:60,tocIndex:28},{value:"-",paraId:60,tocIndex:28},{value:`<ProFormTreeSelect
